//autogenerated:yes
//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_VIDEO_STREAM_TYPE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e VIDEO_STREAM_TYPE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := VIDEO_STREAM_TYPE_RTSP.MarshalText()
		require.NoError(t, err)

		var dec VIDEO_STREAM_TYPE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, VIDEO_STREAM_TYPE_RTSP, dec)
	})
}
